export default class home extends Component {
    render() {
        return (
            <div>
                <div style={{ backgroundImage: "http://localhost:3000/images/background.png", height: "42px" }}>
                    <img src="http://localhost:3000/images/background.png"></img>

                </div>
                
            </div>
        )
    }
}
